if mibBuilder.loadTexts: mscDpnGateActivateReason.setDescription('This attribute indicates the reason the DpnGateway has been activated by the remote end. The value corresponds to the link type of the DPN end. It is always unknown until the link comes into service. If this attribute is set to dedicated, the DPN is a dedicated network link. If this attribute is set to dnl, the DPN end is a dial network link, meaning a network link which is connected through a dial-up service. If this attribute is set to dbnl, the DPN end is dial backup network link, activated because the main network link is out of service. If this attribute is set to bwod, the DPN end is a bandwidth on demand link, activated because extra bandwidth is required. If the attribute is set to unknown, the link is either not currently in use, or the DPN end has an unrecognized link type.')
